import React from 'react';
import ReactDOM from 'react-dom/client';

let a=2,b=3;
let pirmas="didesnis";
if(a<b)
    pirmas="mazesnis";

const info = (
  <>
    <h1 className="informacija">JSX pavyzdys</h1>
    <p>Skaiciu suma bus {a+b}. Pirmas skaicius {pirmas}</p>
  </>
);

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(info);
